/** This executes a create entry */
function processCreateEntry(key,createEntry,baseMap) {
    baseMap[key] = createEntry;
}

/** This executes an extend entry */
function processExtendsEntry(key,extendsEntry,baseMap) {
    var extendedEntry = baseMap[extendsEntry.extends];
    if(!extendedEntry) {
        throw new Error("Extended entry not found: " + extendsEntry.extends);
    }

    //make the new entry
    var newEntry = apogee.util.jsonCopy(extendedEntry);
    //set name
    newEntry.name = extendsEntry.name;
    //set parent
    if(newEntry.parent) {
        newEntry.parent.push(extendedEntry.name)
    }
    else {
        newEntry.parent = [extendedEntry.name];
    }

    //insert it
    if(baseMap[key]) throw new Error("Repeat entry: " + key);
    baseMap[key] = newEntry;

    //do any modification
    doEntryModify(extendsEntry,newEntry);
}

/** This executes a modify entry. */
function processModifyEntry(key,modifyEntry,baseMap) {
    var originalEntry = baseMap[modifyEntry.modifies];
    if(!originalEntry) throw new Error("Modified entry not found: " + key);

    var modifiedEntry = apogee.util.jsonCopy(originalEntry);
    baseMap[key] = modifiedEntry;

    //do any modification
    doEntryModify(modifyEntry,modifiedEntry);
}

/** This exectues a delete entry */
function processDeleteEntry(key,deleteEntry,baseMap) {
    var deletedEntry = baseMap[deleteEntry.delete];
    if(!deletedEntry) throw new Error("Deleted entry not found: " + key);

    //do any modification
    delete baseMap[key];
}

/** This implements a modify on the given entry - called from both modify and extend. */
function doEntryModify(modifyingEntry,entryToModify) {
    for(var field in modifyingEntry) {
        //don't update these
        if((field == "name")||(field == "extends")||(field == "modifies")) continue;

        if(field == "properties") {
            //update the properties
            modifyPropertyList(modifyingEntry.properties,entryToModify.properties);
        }
        else {
            //update other fields
            entryToModify[field] = modifyingInstructions[field];
        }
    }
}


/** This method takes a modifying list of properties and acts them on a list of base properties.*/
function modifyPropertyList(modifyingList,listToModify) {
    //act each modifying property
    modifyingList.forEach(modifyInstruction => modifyPropertyFromList(modifyInstruction,listToModify))
}

/** This acts a single modify property on a list of properties. */
function modifyPropertyFromList(modifyInstruction,propertiesToModify) {

    var matchKey = property => (modifyInstruction.key == property.key);

    var indexToModify = propertiesToModify.findIndex(matchKey);

    //create
    if(modifyInstruction.action === undefined) {
        //create
        if(indexToModify >= 0) {
            throw new Error("Property found when it shouldn't be: " + modifyInstruction.key);
        }

        propertiesToModify.push(modifyInstruction);
        return;
    }
    else {
        //modify,replace,delete
        if(indexToModify < 0) {
            throw new Error("Property not found: " + modifyInstruction.key);
        }


        switch(modifyInstruction.action) {
            case "modifies":
                modifyProperty(modifyInstruction,propertiesToModify[indexToModify]);
                break;

            case "replaces":
                propertiesToModify[indexToModify] = modifyInstruction;
                break;

            case "delete":
                propertiesToModify.splice(indexToModify,1);
                break;

            default:
                throw new Error("UNknown instruction: " + modifyInstruction.action);
        }
    }

}

/** This implements modify on a single property. */
function modifyProperty(instruction,property) {
    for(var field in instruction) {
        //don't change these
        if((field == "key")||(field == "action")) continue;

        //special cases
        if((instruction.type == "enum")&&(field == "values")) {
            modifyEnum(instruction[field],property[field]);
        }
        else if(instruction.type == "conditional") {
            if(field == "cases") {
                throw new Error("Modifying conditional cases not supported!");
            }
            else if(field == "default") {
                throw new Error("Modifying conditional default not supported!");
            }
        }
        else if((instruction.type == "multikey")&&(field == "options")) {
            modifyPropertyList(instruction[field],property[field]);
        }
        else {
            //standard case
            property[field] = instruction[field];
        }
    } 
}

/** This does the modify instruction for an enm type property. */
function modifyEnum(modifyingValueList,valueListToModify) {
    //only "add" supported for now in enum
    var addToBase = (valueEntry) => valueListToModify(valueEntry);
    modifyingValueList.forEach(addToBase);
}

